window.bookSummaryJSON = "<p><i>This is it.</i></p> <p><b>Alpha team goes once more into the breach.</b></p> <p>On what will be their final missions ever in the Zulu Alpha - and the fight of their lives â€” Homer &amp; Ali, and Predator &amp; Juice, launch out into the terminal post-Apocalypse, as London is overrun by the very last rush of death covering the entire planet. Neither mission can fail, but can all four teammates survive? Or will some go down safeguarding the lives of those they love more than life itself?</p> <p><b>Handon fights his way back from the dead.</b></p> <p>As reinforcements flood into CentCom, ahead of the onslaught of the undead world, one man lies in a coma at the heart of humanity's final fallback position. But will the ghosts of all those who've fallen before, and the love of those who yet remain, be enough to bring him back to life, and back to the fight, in time to lead the final battle?</p> <p><b>The last survivors man the Alamo of the Alamo.</b></p> <p>As CentCom is overrun, and it all collapses and the screen goes black, the last heroes of humanity have one final chance to save the world. But as they cling to one another in their shrinking circle of life, will they be able pull it off from the mast of the last sinking ship in a world submerged in a sea of death...?</p> <p>Love. Death. The End of the line. <i>Endgame</i>.</p>"; 
